import { connect } from 'react-redux'

class Login extends Component {

    render() { 
      return (
        <div class="container">

     		<div class="col-md-12">
        <div class="row">
        	<h4><strong>Welcome To Would You Rather App!</strong></h4>
        	Please sign in to continue
        	</div>
  			</div>     
        </div>    
      )
    }
  }

  export default connect()(Login)
